import React, { useEffect, useState } from 'react';

interface ResponseData {
  control_ctr: number;
  p_value: number;
  status: string;
  variant_ctr: number;
  winner: string;
}

const TestResults: React.FC = () => {
  const [responseData, setResponseData] = useState<ResponseData | null>(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:5000/calculate_ab_test_winner?test_id=123');
        const data = await response.json();
        setResponseData(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      {responseData ? (
        <div>
          <p>control_ctr: {responseData.control_ctr}</p>
          <p>p_value: {responseData.p_value}</p>
          <p>status: {responseData.status}</p>
          <p>variant_ctr: {responseData.variant_ctr}</p>
          <p>winner: {responseData.winner}</p>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default TestResults;
